import React from 'react';
import Navbar from './components/Navbar';
import Section from './components/Section';

function App() {
  const sections = [
    {
      id: 'edge-detector',
      title: 'Edge Detector',
      content: [
        { title: 'Sobel Filter', description: 'Detects edges by...', imageUrl: '/images/sobel.jpg' },
        { title: 'Canny Edge Detector', description: 'A popular edge detection technique...', imageUrl: '/images/canny.jpg' },
      ],
    },
    {
      id: 'image-sharpening',
      title: 'Image Sharpening',
      content: [
        { title: 'Laplacian Sharpening', description: 'Enhances image details...', imageUrl: '/images/laplacian.jpg' },
      ],
    },
    {
      id: 'hybrid-images',
      title: 'Hybrid Images',
      content: [
        { title: 'Hybrid Technique', description: 'Combines low and high frequencies...', imageUrl: '/images/hybrid.jpg' },
      ],
    },
    {
      id: 'image-blending',
      title: 'Image Blending',
      content: [
        { title: 'Blend Modes', description: 'Smoothly merge images together...', imageUrl: '/images/blending.jpg' },
      ],
    },
  ];

  return (
    <div className="flex min-h-screen bg-gradient-to-r from-gray-900 via-gray-800 to-black text-gray-300">
      <Navbar />

      {/* Main Content */}
      <div className="flex-1 p-8 ml-64">
        <h1 className="text-4xl font-bold text-center mb-12 text-white">Image Filters</h1>

        {sections.map((section) => (
          <Section key={section.id} id={section.id} title={section.title} content={section.content} />
        ))}
      </div>
    </div>
  );
}

export default App;
